(281, 14, '@v2blaster228', '[{\"text\": \"The crux of the issue is that you need to struggle mentally to really internalize difficult topics. 100% agree that you should \\\"test yourself\\\" before consulting some AI to improve upon your solution. Not to mention how it\'s entirely possible for the AI to feed someone the wrong information and them having too much trust to fact-check it.\"}]'),
