(285, 14, '@ds5015', '[{\"text\": \"It\\u2019s how you use it.\"}, {\"text\": \"\\n\"}, {\"text\": \"If people use it to help you learn to fish, then you will be a great fisherman.\"}, {\"text\": \"\\n\"}, {\"text\": \"If people just ask it to please go get me a fish, then you will never be a great fisherman.\"}, {\"text\": \"\\n\"}, {\"text\": \"Great video!\"}]'),
